import { useCallback } from "react";

interface CustomSounds {
  // Básicos
  correct: string;
  wrong: string;
  
  // Gamificação
  streak: string;
  beetz: string;
  levelUp: string;
  
  // Contextuais por distrito
  crypto: string;
  finance: string;
  education: string;
  
  // Eventos especiais
  combo: string;
  perfectScore: string;
  achievement: string;
}

const CUSTOM_SOUNDS: CustomSounds = {
  // Sons básicos - mais sutis
  correct: "data:audio/wav;base64,",
  // Som melhorado (mais curto e agradável)
  wrong: "data:audio/wav;base64,UklGRp4DAABXQVZFZm10IBAAAAABAAEARKwAAIhYAQACABAAZGF0YYADAAAAfAmw/zBMADs=",
  // Outros sons contextuais
  streak: "data:audio/wav;base64,UklGRlgBAABXQVZFZm10IBAAAAABAAEAgD4AAIA+AAABAAgAZGF0YQAAAAA=",
  beetz: "data:audio/wav;base64,UklGRlgBAABXQVZFZm10IBAAAAABAAEAgD4AAIA+AAABAAgAZGF0YQAAAAA=",
  levelUp: "data:audio/wav;base64,UklGRlgBAABXQVZFZm10IBAAAAABAAEAgD4AAIA+AAABAAgAZGF0YQAAAAA=",
  
  // Sons específicos por distrito
  crypto: "data:audio/wav;base64,UklGRlgBAABXQVZFZm10IBAAAAABAAEAgD4AAIA+AAABAAgAZGF0YQAAAAA=",
  finance: "data:audio/wav;base64,UklGRlgBAABXQVZFZm10IBAAAAABAAEAgD4AAIA+AAABAAgAZGF0YQAAAAA=",
  education: "data:audio/wav;base64,UklGRlgBAABXQVZFZm10IBAAAAABAAEAgD4AAIA+AAABAAgAZGF0YQAAAAA=",
  
  // Eventos especiais
  combo: "data:audio/wav;base64,UklGRlgBAABXQVZFZm10IBAAAAABAAEAgD4AAIA+AAABAAgAZGF0YQAAAAA=",
  perfectScore: "data:audio/wav;base64,UklGRlgBAABXQVZFZm10IBAAAAABAAEAgD4AAIA+AAABAAgAZGF0YQAAAAA=",
  achievement: "data:audio/wav;base64,UklGRlgBAABXQVZFZm10IBAAAAABAAEAgD4AAIA+AAABAAgAZGF0YQAAAAA="
};

export function useCustomSounds() {
  const playSound = useCallback((soundType: keyof typeof CUSTOM_SOUNDS, volume: number = 0.3) => {
    try {
      const audio = new Audio(CUSTOM_SOUNDS[soundType]);
      audio.volume = volume;
      audio.play().catch(error => {
        console.log('Error playing sound:', error);
      });
    } catch (error) {
      console.log('Error creating audio:', error);
    }
  }, []);

  const playCorrectSound = useCallback(() => playSound('correct'), [playSound]);
  const playWrongSound = useCallback(() => playSound('wrong'), [playSound]);
  const playStreakSound = useCallback(() => playSound('streak'), [playSound]);
  const playBeetzSound = useCallback(() => playSound('beetz'), [playSound]);
  const playLevelUpSound = useCallback(() => playSound('levelUp'), [playSound]);
  const playComboSound = useCallback(() => playSound('combo'), [playSound]);
  const playPerfectScoreSound = useCallback(() => playSound('perfectScore'), [playSound]);
  const playAchievementSound = useCallback(() => playSound('achievement'), [playSound]);

  // Sons contextuais por distrito
  const playDistrictSound = useCallback((district: string) => {
    const soundKey = CUSTOM_SOUNDS[district as keyof typeof CUSTOM_SOUNDS] 
      ? district as keyof typeof CUSTOM_SOUNDS 
      : 'correct';
    playSound(soundKey);
  }, [playSound]);

  const playCountdownSound = useCallback(() => {
    console.log('🔊 Tentando tocar som de countdown');
    try {
      const audio = new Audio('/audio/10sec-digital-countdown-sfx-319873.mp3');
      console.log('🔊 Arquivo de áudio criado:', audio.src);
      audio.volume = 0.15; // Volume mais baixo que os demais sons
      
      // Parar o áudio após 10 segundos para sincronizar com o timer
      setTimeout(() => {
        audio.pause();
        audio.currentTime = 0;
        console.log('🔊 Som de countdown parado após 10 segundos');
      }, 10000);
      
      audio.play().then(() => {
        console.log('🔊 Som de countdown tocado com sucesso');
      }).catch((error) => {
        console.warn('⚠️ Erro ao tocar countdown:', error);
      });
    } catch (error) {
      console.warn('⚠️ Erro ao criar countdown:', error);
    }
  }, []);

  return {
    playCorrectSound,
    playWrongSound,
    playStreakSound,
    playBeetzSound,
    playLevelUpSound,
    playComboSound,
    playPerfectScoreSound,
    playAchievementSound,
    playDistrictSound,
    playCountdownSound,
    playSound
  };
}